ReactDOM.render(
  <Router>
    <Routes>
        <Route path='/' element={<Login/>}/>
        <Route path='/GuestHomepage' element = {<GuestHomepage/>}/>
        <Route path='/HostHomepage' element = {<HostHomepage/>}/>



    </Routes>
  </Router>,

 document.getElementById('root')
);
